	"""
		Is s a palindrome.

		S must be a string.
	"""

	l = len(s)

	if (l % 2) == 0:
		frontHalf = s[0:l/2]
		backHalf = s[l/2:]
	else:
		frontHalf = s[0:(l-1)/2]
		backHalf = s[(l+1)/2:]

	backHalf = backHalf[::-1]

	if frontHalf == backHalf:
		return True
	else:
		return False

